import React, { Component } from "react";
import ReactDOM from 'react-dom';
import PropTypes from "prop-types";




const social= {
    backgroundColor: '#ffcccb ',
    padding: "0",
    margin: "0",
    color: "green",
    display: "flex",
    justifyContent: "space-around",
    fontSize: "15px"

}


class Footer extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() {
        return (
            <div style={social}>
                <div ClassName="Item1">
                    <table>
                        <tr>
                            <td>{this.props.footer1}</td>
                            <td>{this.props.footer1}</td>
                        </tr>
                    </table>
                    </div>
                <div ClassName="Item2">
                    <table>
                        <tr>
                            <td>{this.props.footer2}</td>
                            <td>{this.props.footer2}</td>
                        </tr>
                    </table>
                    </div>
                <div ClassName="Item3">
                    <table>
                        {this.props.footer3}
                    </table>
                    </div>
                <div ClassName="Item4"><h4>{this.props.footer4}</h4></div>
            </div>
        );
    }
}

export default Footer;
